import Layout from '../components/Layout';
import Head from 'next/head';

const Home = () => (
    <Layout>
        <div id="bg">
            <img src="/image.jpg" alt="homepage image" />
            <Head>
               <div id="home-text-box">
                <h4>Hello</h4>
                <p>I am a fullstack Web Developer</p> 
            </div>  
            </Head>


        </div>
        <button type="submit">Hello</button>
    <style jsx>{`
        #bg {
            top: -50%; 
            left: -50%; 
            width: 100%; 
            height: 200%;
        }
        #bg img {
            position: fixed; 
            top: 0; 
            left: 0; 
            right: 0; 
            bottom: 0; 
            margin: auto; 
            min-width: 50%;
            min-height: 50%;
            z-index: -1;
        }
        #home-text-box {
            border: 1px solid black;
            padding: 10px;
            text-align: center;
            position: fixed;
            top: 50%;
            left: 50%;
            margin-left: -100px;
            margin-top: -50px;
            font-family: Comfortaa;
            font-size: 30px;
        }
    `}</style>
    <style global jsx>{`
        html,
        body {
            font-family: Comfortaa;
        }
    `}</style>
    </Layout>


)

export default Home;
